# Create segmentation based on website visits and time spent on the website
def determine_engagement(row):
    if row['website_visits'] == 0 and row['time_spent_on_website'] == 0:
        return 'App Only'
    elif row['website_visits'] > 0 and row['time_spent_on_website'] > 0:
        return 'Website'
    else:
        return 'Neither'

# Apply the function to create the new feature
data_v2['engagement_type'] = data_v2.apply(determine_engagement, axis=1)

# Quick check of the new feature
print("Value counts for 'engagement_type':")
print(data_v2['engagement_type'].value_counts())

